// import logo from '../images/logo.svg'; how to import photos; code: src={logo}
import React, { Component } from 'react';
import './App.css';
import Home from './views/Home.js';
import Projects from './views/Projects.js';
import {BrowserRouter, Route} from 'react-router-dom';

// This basically just tells the App which javascript files to go to based on different URLs
class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          <Route exact={true} path='/:state' render={() => (
            <div className="App">
              <Home projects={this.props.projects} state={props.match.params.state}/>
            </div>
          )}/>
          <Route
            exact={true}
            path='/projects/:id'
            render={(props) => (

              <Projects projects={this.props.projects} id={props.match.params.id}/>
            )}

          />
            {/*render = {() => <Projects projects={this.props.projects} />}*/}
        </div>
      </BrowserRouter>
    );
  }
}
export default App;
